TH1TH1C : histograms with one byte per channel.   Maximum bin content = 127

TH1S : histograms with one short per channel.  Maximum bin content = 32767

TH1I : histograms with one int per channel.    Maximum bin content = 2147483647

TH1F : histograms with one float per channel.  Maximum precision 7 digits

TH1D : histograms with one double per channel. Maximum precision 14 digits

The TH*C classes also inherit from the array class TArrayC.
The TH*S classes also inherit from the array class TArrayS.
The TH*I classes also inherit from the array class TArrayI.
The TH*F classes also inherit from the array class TArrayF.
The TH*D classes also inherit from the array class TArrayD.
When an histogram is created, a reference to it is automatically added to the list of in-memory objects for the current file or directory. This default behaviour can be changed by:h->SetDirectory(0);          // for the current histogram h
TH1::AddDirectory(kFALSE);   // sets a global switch disabling the reference
When the histogram is deleted, the reference to it is removed from the list of objects in memory. When a file is closed, all histograms in memory associated with this file are automatically deleted.All histogram types support either fix or variable bin sizes. 2-D histograms may have fix size bins along X and variable size bins along Y or vice-versa. The functions to fill, manipulate, draw or access histograms are identical in both cases.Convention for numbering binsFor all histogram types: nbins, xlow, xupbin = 0;       underflow bin
bin = 1;       first bin with low-edge xlow INCLUDED
bin = nbins;   last bin with upper-edge xup EXCLUDED
bin = nbins+1; overflow bin
