TPad继承 TVirtualPad, TAttBBox2DThe most important graphics class in the ROOT system.A Pad is contained in a Canvas.A Pad may contain other pads (unlimited pad hierarchy).A pad is a linked list of primitives of any type (graphics objects,
histograms, detectors, tracks, etc.).Adding a new element into a pad is in general performed by the Draw
member function of the object classes.It is important to realize that the pad is a linked list of references
to the original object.
For example, in case of a histogram, the histogram.Draw() operation
only stores a reference to the histogram object and not a graphical
representation of this histogram.
When the mouse is used to change (say the bin content), the bin content
of the original histogram is changed.The convention used in ROOT is that a Draw operation only adds
a reference to the object. The effective drawing is performed
when the canvas receives a signal to be painted.In ExecuteEvent, move, changes can be performed on the object.For examples of DistancetoPrimitive and ExecuteEvent functions,
see classes      TLine::DistancetoPrimitive, TLine::ExecuteEvent
      TBox::DistancetoPrimitive,  TBox::ExecuteEvent
      TH1::DistancetoPrimitive,   TH1::ExecuteEvent
A Pad supports linear and log scales coordinate systems.
The transformation coefficients are explained in TPad::ResizePad.class   // TPad status bits
