TTimer *timer = new TTimer();
timer->Connect("Timeout()", "myObjectClassName", myObject, "TimerDone()");
timer->Start(2000, kTRUE);   // 2 seconds single-shot

// Timeout signal is emitted repeadetly with minimum timeout
